import React from 'react';
import {Link} from 'react-router-dom'
import logo from '../assets/icons/logo.png';

const Topbar = () => {
  return (
    <div className="topbar">
      <img src={logo} alt="SportSee" className="logo" />
      <nav className='top-nav-link'>
        <Link to="#" className='topbar-link'>Accueil</Link>
        <Link to="#" className='topbar-link'>Profil</Link>
        <Link to="#" className='topbar-link'>Réglage</Link>
        <Link to="#" className='topbar-link'>Communauté</Link>
      </nav>
    </div>
  );
};

export default Topbar;
